// My Location
L.control.locate().addTo(map);

var myPostion = this.map.locate({
    watch: true,
    setView: true,
    maxZoom: 14
}).on('locationfound', (e) => {
    if (!this.marker) {
        this.marker = leaflet.marker([e.latitude, e.longitude], { icon: myIcon }).addTo(this.map);
    } else {
        this.marker.setLatLng([e.latitude, e.longitude]);
    }
});

if(!navigator.geolocation) {
    console.log("Your browser doesn't support geolocation feature!")
} else {
    
        navigator.geolocation.getCurrentPosition(getPosition)
    
}

var mark;
// // var poi = L.GeometryUtil.closestLayer(mark, police);

    function getPosition(position){
        // console.log(position)
        var lat = position.coords.latitude
        var long = position.coords.longitude
        var accuracy = position.coords.accuracy

        if(mark) {
            map.removeLayer(mark)
        }

        mark = L.marker([lat, long])
    
        // map.fitBounds(mark.getBounds())

        console.log("Your coordinate is: Lat: "+ lat +" Long: "+ long+ " Accuracy: "+ accuracy)
            
        map.on('click', function (e) {
        console.log(e)
        var newMarker = L.marker([e.latlng.lat, e.latlng.lng]).addTo(map);
        L.Routing.control({
            waypoints: [
                L.latLng(lat, long),
                L.latLng(e.latlng.lat, e.latlng.lng)
            ]
        }).on('routesfound', function (e) {
            var routes = e.routes;
            console.log(routes);

            e.routes[0].coordinates.forEach(function (coord, index) {
                setTimeout(function () {
                    marker.setLatLng([coord.lat, coord.lng]);
                }, 100 * index)
            })

        }).addTo(map);
    })};
